import React from "react";

const CssClasses = {
    CONTACT: "contact",
    NAME: "contact__name"
}

const Contact = () => {
    return (
    <div className={CssClasses.CONTACT + " container"}>
        <h1 className={CssClasses.NAME}>Duis Aute</h1>
        <div>
            <ul>
                <li><i className="bi bi-whatsapp"></i>
                </li>
            </ul>

        </div>
    </div>
    );
};

export default Contact;
